import React from 'react';
import AllProducts from './D/AllProducts';  // Import AllProducts
import Notifications from './D/Notifications';  // Import Notifications
import Orders from './D/Orders';  // Import Orders
import Sales from './D/Sales';  // Import Sales
import './D/Dashboard.css';  // Import the CSS for styling

const Dashboard = () => {
  return (
    <div className="dashboard">
      <h1>Dashboard</h1>
      <div className="dashboard-content">
        <AllProducts />  {/* Render AllProducts component */}
        <Notifications />  {/* Render Notifications component */}
        <Orders />  {/* Render Orders component */}
        <Sales />  {/* Render Sales component */}
      </div>
    </div>
  );
};

export default Dashboard;
